class View(QOpenGLWidget):
    
    def __init__(self, parent=None):
        super().__init__(parent)
        for coord in ('x', 'y', 'z', 'cx', 'cy', 'cz', 'rx', 'ry', 'rz'):
            setattr(self, coord, 50 if coord == 'z' else 0)
        self.timer = QTimer(self)
        self.timer.timeout.connect(self.rotate)

    def initializeGL(self):
        glMatrixMode(GL_PROJECTION)
        glEnable(GL_LINE_SMOOTH)  
        glEnable(GL_BLEND)  
        #Set the camera FOV
        glFrustum(self.frustL, self.frustR, self.frustB, self.frustT, self.nearVal, self.farVal)
        #Initialise the polygon lists
        self.groundtrack_polylines = glGenLists(1)
        self.polygons = glGenLists(1)
        self.lake_polygons = glGenLists(1)
        self.river_polylines = glGenLists(1)
        self.points = glGenLists(1)

    def paintGL(self):
        #Create the blue sphere 
        glEnable(GL_DEPTH_TEST)
        glPushMatrix()
        glTranslatef(0, 0, 0)
        glColor(0, 0, 255)
        #Create sphere with radius 6.35 and made up with 128x128 slices
        gluSphere(gluNewQuadric(), 6.35, 128, 128) 
        glPopMatrix()

        #Check if the polygons exist and then rotates depending on the user input
        if hasattr(self, 'polygons'):
           glPushMatrix()
           glRotated(self.rx/16, 1, 0, 0)
           glRotated(self.ry/16, 0, 1, 0)
           glRotated(self.rz/16, 0, 0, 1)
           glCallList(self.polygons)
           glPopMatrix()
        if hasattr(self, 'lake_polygons'):
           glPushMatrix()
           glRotated(self.rx/16, 1, 0, 0)
           glRotated(self.ry/16, 0, 1, 0)
           glRotated(self.rz/16, 0, 0, 1)
           glCallList(self.lake_polygons)
           glPopMatrix()
        if hasattr(self, 'river_polylines'):
           glPushMatrix()
           glRotated(self.rx/16, 1, 0, 0)
           glRotated(self.ry/16, 0, 1, 0)
           glRotated(self.rz/16, 0, 0, 1)
           glCallList(self.river_polylines)
           glPopMatrix()
        if hasattr(self, 'groundtrack_polylines'):
           glPushMatrix()
           glRotated(self.rx/16, 1, 0, 0)
           glRotated(self.ry/16, 0, 1, 0)
           glRotated(self.rz/16, 0, 0, 1)
           glCallList(self.groundtrack_polylines)
           glPopMatrix()
        if hasattr(self, 'points'):
           glPushMatrix()
           glRotated(self.rx/16, 1, 0, 0)
           glRotated(self.ry/16, 0, 1, 0)
           glRotated(self.rz/16, 0, 0, 1)
           glCallList(self.points)
           glPopMatrix()
        glMatrixMode(GL_MODELVIEW)
        glLoadIdentity()
        #Method used to position the camera
        gluLookAt(self.x, self.y, self.z, self.cx, self.cy, self.cz, self.upx, self.upy, self.upz)
        self.update()

