    def keyPressEvent(self, event):
        rotfac = config.camera["rotationFactor"]
        zoomfac = config.camera["zoomFactor"]
        zoomfac=zoomfac+(config.camera["nearVal"]*1000)
        zoomfac=zoomfac*1000
        if event.key() == Qt.Key_Right:
            self.lon = self.lon + rotfac
            self.x,self.y,self.z= self.LLH_to_ECEF(self.lat, self.lon, self.cam_height , 1, False)
        if event.key() == Qt.Key_Left:
            self.lon = self.lon - rotfac
            self.x,self.y,self.z= self.LLH_to_ECEF(self.lat, self.lon, self.cam_height , 1, False)
        if event.key() == Qt.Key_Up:
            self.lat = self.lat + rotfac
            self.x,self.y,self.z= self.LLH_to_ECEF(self.lat, self.lon, self.cam_height , 1, False)
        if event.key() == Qt.Key_Down:
            self.lat = self.lat - rotfac
            self.x,self.y,self.z= self.LLH_to_ECEF(self.lat, self.lon, self.cam_height , 1, False)
        if event.key() == Qt.Key_Control:
            self.cam_height = self.cam_height - zoomfac
            self.x,self.y,self.z= self.LLH_to_ECEF(self.lat, self.lon, self.cam_height , 1, False)
        if event.key() == Qt.Key_Shift:
            self.cam_height = self.cam_height + zoomfac
            self.x,self.y,self.z= self.LLH_to_ECEF(self.lat, self.lon, self.cam_height , 1, False)
        if event.key() == Qt.Key_Space:
            if self.timer.isActive():
                self.timer.stop()
            else:
                self.timer.start()

    def rotate(self):  
        self.rx, self.ry = self.rx + 6, self.ry + 6
            
    #This method is used to subdivide a polygon into 4 polygons and then normalise them to Earth radius 
    def vertices_generator(self,input,height):
        vertices_new=[]
        for i in range(0,len(input),3):
            #Set the 3 vertices of the input triangle
            A=input[i]
            B=input[i+1]
            C=input[i+2]  
            #Initialise vertice D
            D=[]
            #Find the vertice between vertice A and B
            x=(A[0]+B[0])/2
            y=(A[1]+B[1])/2
            z=(A[2]+B[2])/2
            #Normalise the vector
            vector_length= math.sqrt((x*x)+(y*y)+(z*z))
            x=x/vector_length
            y=y/vector_length
            z=z/vector_length
            x=x*6.378137*height
            y=y*6.378137*height
            z=z*6.378137*height
            D.append(x) #x
            D.append(y) #y
            D.append(z) #z
            E=[]
            x=(C[0]+B[0])/2
            y=(C[1]+B[1])/2
            z=(C[2]+B[2])/2
            vector_length= math.sqrt((x*x)+(y*y)+(z*z))
            x=x/vector_length
            y=y/vector_length
            z=z/vector_length
            x=x*6.378137*height
            y=y*6.378137*height
            z=z*6.378137*height
            E.append(x) #x
            E.append(y) #y
            E.append(z) #z
            F=[]
            x=(C[0]+A[0])/2
            y=(C[1]+A[1])/2
            z=(C[2]+A[2])/2
            vector_length= math.sqrt((x*x)+(y*y)+(z*z))
            x=x/vector_length
            y=y/vector_length
            z=z/vector_length
            x=x*6.378137*height
            y=y*6.378137*height
            z=z*6.378137*height
            F.append(x) #x
            F.append(y) #y
            F.append(z) #z

            #Create sub-poygon 1: A-D-F
            vertices_new.append(A)
            vertices_new.append(D)
            vertices_new.append(F)

            #Create sub-poygon 2: D-B-E
            vertices_new.append(D)
            vertices_new.append(B)
            vertices_new.append(E)

            #Create sub-poygon 3: E-C-F
            vertices_new.append(E)
            vertices_new.append(C)
            vertices_new.append(F)

            #Create sub-poygon 4: F-D-E
            vertices_new.append(F)
            vertices_new.append(D)
            vertices_new.append(E)
        #Return the list with all the new vertices
        return vertices_new
    
    #Method used to create the landmasses
    def create_polygons(self,r,g,b,height):
        glNewList(self.polygons,GL_COMPILE)
        #Extract polygons from shapefile
        for polygon in self.extract_polygons():
            #Create the line around the country/polygon
            glLineWidth(1.2)
            #Loop because it is closed
            glBegin(GL_LINE_LOOP)
            #line colour 
            glColor(0, 0,0)
            for lon, lat in polygon.exterior.coords:
                #Convert lon and lat coords to x,y,z
                glVertex3f(*self.LLH_to_ECEF(lat, lon, 1 , height, True))
            glEnd()
            #Set the fill colour
            glColor(r, g, b)
            #GL_Triangles renders individual triangles
            glBegin(GL_TRIANGLES)
            #Tesselate the polygons into individual triangles
            for vertex in self.polygon_tesselator(polygon , height , True ):
                glVertex(*vertex)
            glEnd()
        glEndList()

    def create_lake_polygons(self,r,g,b,height):
        glNewList(self.lake_polygons,GL_COMPILE)
        for polygon in self.extract_polygons():
            glLineWidth(1.2)
            glBegin(GL_LINE_LOOP)
            #line colour
            glColor(0, 0,0)
            for lon, lat in polygon.exterior.coords:
                glVertex3f(*self.LLH_to_ECEF(lat, lon, height, height , True))
            glEnd()

            #fill colour
            glColor(r, g, b)
            glBegin(GL_TRIANGLES)
            for vertex in self.polygon_tesselator(polygon , height, True):
                glVertex(*vertex)
            glEnd()
        glEndList()

    #Render rivers/lines 
    def create_river_polylines(self,r,g,b,height):
        glNewList(self.river_polylines,GL_COMPILE)
        #Extract polylines from the shapefile
        for polyline in self.extract_polylines():
            glLineWidth(1)
            #Rivers are strips not loops
            glBegin(GL_LINE_STRIP)
            #line colour
            glColor(r, g,b)
            for lon, lat in polyline.coords:
                glVertex3f(*self.LLH_to_ECEF(lat, lon, 1 , height, True))
            glEnd()
        glEndList()

